  \"2016-03-17T20:52:18.043915\",\n\t\"name\": \"hazardous-substance-incident-tracking-database\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The State of Iowa requires any person manufacturing,
  storing, handling, transporting, or disposing of a hazardous substance to notify
  the Department of Natural Resources and local law enforcement of the occurrence
  of a hazardous condition.rnrnAdditionally, the State of Iowa requires a person storing,
  handling, transporting, or land-applying manure from a confinement feeding operation
  or storing, handling, transporting, or land-applying manure, process wastewater,
  open feedlot effluent, settled open feedlot effluent or settleable solids from an
  open feedlot operation who becomes aware of a release to notify the Department of
  Natural Resources.rnrnThis online database allows the public to view reported spill
  data in their communities.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
